import React from 'react'
import classes from './Appointments.module.css';
import AppointmentsHeader from './AppointmentsHeader./AppointmentsHeader';

const Appointments = () => {
    return (
        <div className={classes.appointments}>
            <AppointmentsHeader />
        </div>
    )
}

export default Appointments
